INSERT INTO `product` VALUES (1,'1 Apple MacBook Air M1 256GB 2020','- Phù hợp cho lập trình viên, thiết kế đồ họa 2D, dân văn phòng\\n - Đa nhiệm mượt mà - Ram 8GB cho phép vừa mở trình duyệt để tra cứu thông tin, vừa làm việc trên phần mềm ',18690000,17000000,3,'https://cdn2.cellphones.com.vn/358x358,webp,q100/media/catalog/product/a/i/air_m2.png','- Macbook Air M1 là dòng sản phẩm có thiết kế mỏng nhẹ, sang trọng và tinh tế cùng với đó là giá thành phải chăng nên MacBook Air đã thu hút được đông đảo người dùng yêu thích và lựa chọn. Đây cũng là một trong những phiên bản Macbook Air mới nhất mà khách hàng không thể bỏ qua khi đến với CellphoneS. Dưới đây là chi tiết về thiết kế, cấu hình của máy. \\n\\n - Macbook Air 2020 M1 mới vẫn luôn tuân thủ triết lý thiết kế với những đường nét đơn nhưng vô cùng sang trọng. Máy có độ mỏng nhẹ chỉ 1,29kg và các cạnh tràn viền khiến thiết bị trở nên đẹp hơn và cao cấp hơn.',1,0,6,'2023-07-16 00:00:00','2023-07-16 00:00:00'),(2,'2 Laptop gaming MSI GF63 Thin 11SC 664VN','I5-11400H/8GB/512GB PCIE/VGA 4GB GTX1650/15.6 FHD 144HZ/WIN11/ĐEN',14000000,13000000,5,'https://cdn2.cellphones.com.vn/x358,webp,q100/media/catalog/product/t/e/text_ng_n_21_.png','- Laptop MSI Gaming GF63 Thin 11SC-664VN là sản phẩm thuộc phân khúc giá tầm trung, phù hợp với những game thủ.\n Đây là dòng laptop có vẻ ngoài nhỏ gọn nhưng vẫn mang đậm phong cách gaming.Vẻ ngoài thanh mảnh nhưng vẫn đậm chất gaming: Nhìn chung, chiếc laptop mang một vẻ ngoài khá thon gọn, tổng bề dày chỉ 21,7 mm và có khối lượng khoảng 1,86kg. Tuy nhiên vì là dòng máy gaming nên ở phần giữa của nắp máy được in chìm logo rồng đỏ quen thuộc nhằm tạo điểm nhấn. Đặc biệt hơn, phần thông gió ở phía dưới được in ẩn hình chữ X khá độc đáo.\n - Dòng Laptop MSI Gaming GF63 Thin 11SC-664VN được trang bị bộ vi xử lý Intel Core thế hệ thứ 11 giúp tăng hiệu suất làm việc lên 15% so với các dòng máy thế hệ trước.',0,0,4,'2023-07-15 00:00:00','2023-07-15 00:00:00'),(3,'3 Laptop Dell Latidude 7320 9PPWV','- I5-1145G7/16GB/256GB PCIE/13.3 FHD/WIN11 PRO/NHẬP KHẨU CHÍNH HÃN',16600000,15000000,8,'https://cdn2.cellphones.com.vn/358x358,webp,q100/media/catalog/product/l/a/laptop-dell-latitude-7320-9ppwv.png','- Laptop Dell Latitude 7320 9PPWV là chiếc laptop được thiết kế chuyên nghiệp để xử lý các tác vụ văn phòng, duyệt web, email,...Màn hình 13.3 inch tiện lợi cho di chuyển, bộ vi xử lý Intel Core i5 siêu mạnh mẽ là những điểm mạnh của chiếc laptop này. Cụ thể hơn hãy xem đoạn mô tả sau đây để nắm được ưu thế khi chọn mua laptop Dell Latitude nhé.Ram lớn, thỏa mãn nhu cầu lưu trữ, Laptop Dell Latitude 7320 9PPWV được tích hợp bộ ram 16GB, cho phép bạn chạy nhiều ứng dụng cùng lúc không lo gián đoạn. Bạn có thể xử lý các tập tin đồ họa, video nhanh chóng, chơi game giải trí ổn định',0,0,1,'2023-07-16 00:00:00','2023-07-16 00:00:00'),(4,'4 Laptop ASUS Gaming TUF FX506LHB-HN188W','- Phù hợp cho lập trình viên, thiết kế đồ họa 2D, dân văn phòng\\n - Đa nhiệm mượt mà - Ram 8GB cho phép vừa mở trình duyệt để tra cứu thông tin, vừa làm việc trên phần mềm ',18690000,17000000,4,'https://cdn2.cellphones.com.vn/358x358,webp,q100/media/catalog/product/a/i/air_m2.png','- Macbook Air M1 là dòng sản phẩm có thiết kế mỏng nhẹ, sang trọng và tinh tế cùng với đó là giá thành phải chăng nên MacBook Air đã thu hút được đông đảo người dùng yêu thích và lựa chọn. Đây cũng là một trong những phiên bản Macbook Air mới nhất mà khách hàng không thể bỏ qua khi đến với CellphoneS. Dưới đây là chi tiết về thiết kế, cấu hình của máy. \\n\\n - Macbook Air 2020 M1 mới vẫn luôn tuân thủ triết lý thiết kế với những đường nét đơn nhưng vô cùng sang trọng. Máy có độ mỏng nhẹ chỉ 1,29kg và các cạnh tràn viền khiến thiết bị trở nên đẹp hơn và cao cấp hơn.',0,0,6,'2023-07-16 00:00:00','2023-07-16 00:00:00'),(5,'5 Apple MacBook Air M1 256GB 2020','- Phù hợp cho lập trình viên, thiết kế đồ họa 2D, dân văn phòng\\n - Đa nhiệm mượt mà - Ram 8GB cho phép vừa mở trình duyệt để tra cứu thông tin, vừa làm 